  input: 'TEXT,F3XA,,"August 6, 2002    This letter is written in response to the
    commission''s letter dated 7/31/02 referencing filing period 1/01/02 - 3/31/02.  This
    identified report indeed discloses contributions with incomplete contributor information.  I
    have gone through our database and have found that several of the contributors
    have responded to our ''best effort'' requests.   All of our solicitation material
    contains the following lines: The Federal Election Commission requires us to obtain
    the following information: Name, Address, Occupation/Title, Name of Firm, Address,
    Telephone Numbers and optional email address.  Contributions which exceed the
    limits permited by, or which may not be accepted under Federal  law, will not
    be used for Federal Election purposes.  Political Contributions are not tax deductible
    for federal income tax purposes.  We do follow up with one letter requesting the
    missing information if not presented at the time of the contribution.  A copy
    of this letter is available upon request. Major Donor contributors are contacted
    by telephone when possible.    A business reply envelope is included with the
    request.  The above mentioned report has been amended to reflect the missing information
    that has been collected to date demonstrating our ''best efforts'' from this reporting
    period.  In the future, we will take the necessary steps and amend missing information
    on past reports."'
